import React from "react";
import '../styles/Header.css'; 

const Header = () => (
  <header className="main-header">
     <img src="/logo.jpg" alt="Logo" className="logo-img" />
      <h2 className="header-title">Informe de Riesgo Psicosocial</h2>
  </header>
);

export default Header;
